import React from 'react';
import { Button,Toast,ToastHeader,ToastBody } from 'reactstrap';



const Example = (props) => {
  return (
    <div>
      <Button color="primary">Önceki
      </Button>

      <Toast>
          <ToastHeader>
            Reactstrap
          </ToastHeader>
          <ToastBody>
            This is a toast on a white background — check it out!
          </ToastBody>
        </Toast>


      <Button color="primary">Sonraki
      </Button>

    </div>
  );
}

export default Example;
